import React from 'react';

// function ListItem(props) {
//     // Correct! There is no need to specify the key here:
//     return (
//         <li>{props.value}</li>
//     );
// }



function Task(props) {
   const content = props.todolist.map((post) =>
       <div key={post.id}>
           <span>{post.id}</span>
           <h3>{post.name}</h3>
           <p>{post.surname}</p>
           <button>Delete</button>
       </div>
   );

    return(
        <div className="mainList">
            {content}
        </div>
    )
}


export default Task;
